SPARQL '''PREFIX ore: <http://www.openarchives.org/ore/terms/>
 select distinct ?s where {
 ?s rdf:type ore:Aggregation
}
 limit 100'''@START

SPARQL '''PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
 select distinct ?s where {
 ?s rdf:type skos:Concept
}
 limit 100'''@START

SPARQL '''PREFIX edm: <http://www.europeana.eu/schemas/edm/>
 PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
 select distinct ?s where {
 ?s rdf:type edm:ProvidedCHO
}
 limit 100'''@START

SPARQL '''PREFIX sioc: <http://rdfs.org/sioc/services#>
